import React from 'react';

const Banner = () => {
  return (
    <div style={{margin:'20px 50px', padding:'20px', border:'1px solid #ccc', borderRadius:'10px', textAlign:'center'}}>
      <h2>누구나 멘토가 될 수 있어요.</h2>
      <p>지식과 경험을 나누고, 의미 있는 인사이트를 전해주세요!</p>
      <button>멘토 지원하기</button>
    </div>
  );
};

export default Banner;
